INSERT INTO `awc_f_forums` VALUES (5,3,'Builder\'s Forum','This section is for people building an OpenROV to discuss techniques, list challenges, and ask questions.',1,0,'2012-07-10 23:43:43','Fusion94',2,'Test Thread',32,1,'0',' ',' ','*','user',0,''),(6,4,'Propulsion','Without a propulsion system, an ROV would just be an anchor with a camera strapped to it. Propulsion systems are often challenging to design because they usually involve moving parts and electronics that must be outside the \"dry area\" of the submarine and',0,0,'2012-07-10 23:46:12',' ',0,' ',0,1,'0',' ',' ','*','*',0,''),(7,4,'Water/Pressure Proofing','One of the things that makes underwater ROVs more challenging to engineer then other telerobots is that they have to be able to withstand great amounts of pressure. In fact, for every 10m (~33ft) of depth an ROV submarine goes, it will experience an addit',0,0,'2012-07-10 23:46:49',' ',0,' ',0,1,'0',' ',' ','user','user',0,''),(8,4,'Tethers','The whole point of telerobots (such as ROVs) is that you can do things in places without having to go there yourself. Of course, telerobtic exploration would not be possible if there weren\'t a way to communicate between the robot and the operator, so esta',0,0,'2012-07-10 23:48:46',' ',0,' ',0,1,'0',' ',' ','*','*',0,''),(9,6,'Onboard Electronics',' ',0,0,'2012-07-10 23:49:12',' ',0,' ',0,1,'0',' ',' ','*','*',0,''),(10,4,'Payloads',' ',0,0,'2012-07-10 23:49:25',' ',0,' ',0,1,'0',' ',' ','*','*',0,''),(11,5,'User Interface',' ',0,0,'2012-07-10 23:49:39',' ',0,' ',0,1,'0',' ',' ','*','*',0,''),(12,3,'Adventures','Where would you like to go with OpenROV? This is the spot for adventure ideas that either you would like to go to yourself, or that you think it would be neat for others with OpenROVs to explore.',0,0,'2012-07-10 23:50:06',' ',0,' ',0,1,'0',' ',' ','*','*',0,''),(13,3,'Uncategorized','Existing discussions that have not been assigned a category.\r\n',0,0,'2012-07-10 23:50:24',' ',0,' ',0,1,'0',' ',' ','*','*',0,''),(14,5,'Software',' ',0,0,'2012-07-11 01:15:07',' ',0,' ',0,1,'0',' ',' ','*','*',0,'');
