ernal links.\nTo help protect against automated spam, please solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-badlogin','s:156:\"To help protect against automated password cracking, please solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-createaccount','s:155:\"To help protect against automated account creation, please solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-createaccount-fail','s:39:\"Incorrect or missing confirmation code.\";'),('en','messages:captcha-create','s:123:\"To create the page, please solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-sendemail','s:147:\"To help protect against automated spamming, please solve the simple sum below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-sendemail-fail','s:39:\"Incorrect or missing confirmation code.\";'),('en','messages:captcha-disabledinapi','s:74:\"This action requires a captcha, so it cannot be performed through the API.\";'),('en','messages:captchahelp-title','s:12:\"CAPTCHA help\";'),('en','messages:captchahelp-cookies-needed','s:71:\"You will need to have cookies enabled in your browser for this to work.\";'),('en','messages:captchahelp-text','s:933:\"Web sites that accept postings from the public, like this wiki, are often abused by spammers who use automated tools to post their links to many sites.\nWhile these spam links can be removed, they are a significant nuisance.\n\nSometimes, especially when adding new web links to a page, the wiki may show you an image of colored or distorted text and ask you to type the words shown.\nSince this is a task that\'s hard to automate, it will allow most real humans to make their posts while stopping most spammers and other robotic attackers.\n\nUnfortunately this may inconvenience users with limited vision or using text-based or speech-based browsers.\nAt the moment we do not have an audio alternative available.\nPlease contact the  [[{{MediaWiki:Grouppage-sysop}}|site administrators]] for assistance if this is unexpectedly preventing you from making legitimate posts.\n\nHit the \'back\' button in your browser to return to the page editor.\";'),('en','messages:captcha-addurl-whitelist','s:285:\" #<!-- leave this line exactly as it is --> <pre>\n# Syntax is as follows:\n#   * Everything from a \"#\" character to the end of the line is a comment\n#   * Every non-blank line is a regex fragment which will only match hosts inside URLs\n #</pre> <!-- leave this line exactly as it is -->\";'),('en','messages:right-skipcaptcha','s:75:\"Perform CAPTCHA-triggering actions without having to go through the CAPTCHA\";'),('en','messages:gadgets-desc','s:116:\"Lets users select custom [[Special:Gadgets|CSS and JavaScript gadgets]] in their [[Special:Preferences|preferences]]\";'),('en','messages:prefs-gadgets','s:7:\"Gadgets\";'),('en','messages:gadgets-prefstext','s:535:\"Below is a list of special gadgets you can enable for your account.\nThese gadgets are mostly based on JavaScript, so JavaScript has to be enabled in your browser for them to work.\nNote that these gadgets will have no effect on this preferences page.\n\nAlso note that these special gadgets are not part of the MediaWiki software, and are usually developed and maintained by users on your local wiki.\nLocal administrators can edit the [[MediaWiki:Gadgets-definition|definitions]] and [[Special:Gadgets|descriptions]] of available gadgets.\";'),('en','messages:gadgets','s:7:\"Gadgets\";'),('en','messages:gadgets-definition','s:0:\"\";'),('en','messages:gadgets-title','s:7:\"Gadgets\";'),('en','messages:gadgets-pagetext','s:277:\"Below is a list of special gadgets users can enable on their [[Special:Preferences|preferences page]], as defined by the [[MediaWiki:Gadgets-definition|definitions]].\nThis overview provides easy access to the system message pages that define each gadget\'s description and code.\";'),('en','messages:gadgets-uses','s:4:\"Uses\";'),('en','messages:gadgets-required-rights','s:54:\"Requires the following {{PLURAL:$2|right|rights}}:\n\n$1\";'),('en','messages:gadgets-required-skins','s:59:\"Available on the {{PLURAL:$2|$1 skin|following skins: $1}}.\";'),('en','messages:gadgets-default','s:32:\"Enabled for everyone by default.\";'),('en','messages:gadgets-export','s:6:\"Export\";'),('en','messages:gadgets-export-title','s:13:\"Gadget export\";'),('en','messages:gadgets-not-found','s:22:\"Gadget \"$1\" not found.\";'),('en','messages:gadgets-export-text','s:382:\"To export the $1 gadget, click on \"{{int:gadgets-export-download}}\" button, save the downloaded file,\ngo to Special:Import on destination wiki and upload it. Then add the following to MediaWiki:Gadgets-definition page:\n<pre>$2</pre>\nYou must have appropriate permissions on destination wiki (including the right to edit system messages) and import from file uploads must be enabled.\";'),('en','messages:gadgets-export-download','s:8:\"Download\";'),('en','messages:pfunc_desc','s:37:\"Enhance parser with logical functions\";'),('en','messages:pfunc_time_error','s:20:\"Error: Invalid time.\";'),('en','messages:pfunc_time_too_long','s:28:\"Error: Too many #time calls.\";'),('en','messages:pfunc_time_too_big','s:44:\"Error: #time only supports years up to 9999.\";'),('en','messages:pfunc_rel2abs_invalid_depth','s:80:\"Error: Invalid depth in path: \"$1\" (tried to access a node above the root node).\";'),('en','messages:pfunc_expr_stack_exhausted','s:34:\"Expression error: Stack exhausted.\";'),('en','messages:pfunc_expr_unexpected_number','s:36:\"Expression error: Unexpected number.\";'),('en','messages:pfunc_expr_preg_match_failure','s:48:\"Expression error: Unexpected preg_match failure.\";'),('en','me