ts foru800 output from theu800 node server inu800 theu800 form ofu800 timestamp-format strings over standard input stdin . essentially theu800 node process says u8e2809ctake au800 photou8e2809d sayu800 30u800 times peru800 second tou800 theu800 capture process which then captures andu800 saves theu800 photo tou800 shared memory after which itu800 writes theu800 timestamp-format string through standard outu800 stdout tou800 theu800 node server - asu800 au800 sort ofu800 u8e2809chere youu800 gou8e2809d response. theu800 node server then opens theu800 file ofu800 theu800 name itu800 receives timestamp-format string andu800 reads itu800 asu800 au800 base64-encoded string. then theu800 node server sends that string tou800 theu800 client. theu800 client receives theu800 base64-encoded string through javascript which then updates theu800 source attribute ofu800 theu800 imgu800 tagu800 tou800 that string. theu800 user sees au800 newu800 image. since socketu82eiou800 isu800 au800 twou800-wayu800 communication layer theu800 user canu800 send control commands tou800 theu800 rovu800 anytime. theu800 user does sou800 byu800 interacting with theu800 keyboard oru800 gamepad which sends string-formatted commands using javascript tou800 theu800 rovu800. theu800 node server onu800 theu800 rovu800 then intercepts theu800 move command which itu800 then forwards tou800 theu800 onu800-board arduino tou800 actuate theu800 motors. ');
