e(V, LOW);\n          analogWrite(v, x);\n          break;\n        case \'h\':\n          i++;\n          analogWrite(l, i);\n          break;\n        case \'l\':\n          i--;\n          analogWrite(l, i);\n          break;\n        case \'1\':\n          x = 50;\n          break;\n        case \'2\':\n          x = 150;\n          break;\n        case \'3\':\n          x = 250;\n          break;\n        case \'q\':\n          pos = 30;\n          break;\n        case \'a\':\n          pos = 80;\n          break;\n        case \'z\':\n          pos = 150;\n          break;\n        default:\n          analogWrite(s, 0);\n          analogWrite(v, 0);\n          analogWrite(p, 0);\n          //pos = 80;\n       }\n\n    // set servo position according to value of pos\n    tilt.write(pos);\n    }\n}\n</code>','utf-8'),(42,'<code lang=\'c\' download>\n//OBCROV-1 (On-Board Controller for ROV-1)\n//Created by Eric Stackpole for OpenROV\n//This code allows an Arduino microcontroller to command three motors, a light, and a servo based on serial input sent though it\'s USB plug from an external source\n//This program works with \"TSCROV-1 (Top-Side Controller for ROV-1)\" which can be found on OpenROV.com\n//To see a video of the code working, watch the YouTube Video at http://www.youtube.com/watch?v=8r7Kt1p31vs\n\n//OBCROV-1 by Eric Stackpole is licensed under a Creative Commons Attribution-NonCommercial-ShareAlike 3.0 Unported License.\n//For more informatino, please visit OpenROV.com\n\n#include <Servo.h>  //Allow the Arduino to understand code for controlling a servo\n\n// Arduino pins that each variable will control\n// Upper Case for Direction, Lower Case for PWM\nconst int V = 8;   //Vertical direction\nconst int P = 12;  //Port (left) direction\nconst int S = 13;  //Starbord (right) direction\nconst int v = 3;   //Vertical PWM (speed)\nconst int p = 5;   //Port (left) PWM (speed)\nconst int s = 6;   //Starbord (right) PWM (speed)\nconst byte l = 11; //Light PWM (intensity)\n\n// Set inital angle of servo (intended to control tilt angle of a camera)\nServo tilt;\nint pos = 80;\n\nvoid setup(){\n \n  // initialize the serial communication:\n  Serial.begin(9600);\n\n  // initialize the pins as an outputs:\n  pinMode(V, OUTPUT);\n  pinMode(P, OUTPUT);\n  pinMode(S, OUTPUT);\n  pinMode(v, OUTPUT);\n  pinMode(p, OUTPUT);\n  pinMode(s, OUTPUT);\n  pinMode(l, OUTPUT);\n \n  // attach the servo on pin 14 (analog 0) to the servo object, \"tilt\"\n  tilt.attach(14);\n}\n\n  byte input;\n  byte x = 250;\n  byte i = 128;\n\nvoid loop(){\n  if (Serial.available()){\n    input = Serial.read();\n\n//Turn motors on/off at speed \"x\" (lower case) and direction (upper case) based on input of F (Forward), A (Aft), P (Port), S (Starbord), V (Vertical)\n      switch (input){\n        case \'F\':\n          digitalWrite(P, HIGH);\n          digitalWrite(S, HIGH);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'A\':\n          digitalWrite(P, LOW);\n          digitalWrite(S, LOW);\n          analogWrite(p, x);\n          analogWrite(s, x);         \n          break;\n        case \'P\':\n          digitalWrite(P, LOW);\n          digitalWrite(S, HIGH);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'S\':\n          digitalWrite(P, HIGH);\n          digitalWrite(S, LOW);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'U\':\n          digitalWrite(V, HIGH);\n          analogWrite(v, x);\n          break;\n        case \'D\':\n          digitalWrite(V, LOW);\n          analogWrite(v, x);\n          break;\n        case \'h\':\n          i++;\n          analogWrite(l, i);\n          break;\n        case \'l\':\n          i--;\n          analogWrite(l, i);\n          break;\n        case \'1\':\n          x = 50;\n          break;\n        case \'2\':\n          x = 150;\n          break;\n        case \'3\':\n          x = 250;\n          break;\n        case \'q\':\n          pos = 30;\n          break;\n        case \'a\':\n          pos = 80;\n          break;\n        case \'z\':\n          pos = 150;\n          break;\n        default:\n          analogWrite(s, 0);\n          analogWrite(v, 0);\n          analogWrite(p, 0);\n          //pos = 80;\n       }\n\n    // set servo position according to value of pos\n    tilt.write(pos);\n    }\n}\n</code>','utf-8'),(43,'<code lang=\'c\'>\n//OBCROV-1 (On-Board Controller for ROV-1)\n//Created by Eric Stackpole for OpenROV\n//This code allows an Arduino microcontroller to command three motors, a light, and a servo based on serial input sent though it\'s USB plug from an external source\n//This program works with \"TSCROV-1 (Top-Side Controller for ROV-1)\" which can be found on OpenROV.com\n//To see a video of the code working, watch the YouTube Video at http://www.youtube.com/watch?v=8r7Kt1p31vs\n\n//OBCROV-1 by Eric Stackpole is licensed under a Creative Commons Attribution-NonCommercial-ShareAlike 3.0 Unported License.\n//For more informatino, please visit OpenROV.com\n\n#include <Servo.h>  //Allow the Arduino to understand code for controlling a servo\n\n// Arduino pins that each variable will control\n// Upper Case for Direction, Lower Case for PWM\nconst int V = 8;   //Vertical direction\nconst int P = 12;  //Port (left) direction\nconst int S = 13;  //Starbord (right) direction\nconst int v = 3;   //Vertical PWM (speed)\nconst int p = 5;   //Port (left) PWM (speed)\nconst int s = 6;   //Starbord (right) PWM (speed)\nconst byte l = 11; //Light PWM (intensity)\n\n// Set inital angle of servo (intended to control tilt angle of a camera)\nServo tilt;\nint pos = 80;\n\nvoid setup(){\n \n  // initialize the serial communication:\n  Serial.begin(9600);\n\n  // initialize the pins as an outputs:\n  pinMode(V, OUTPUT);\n  pinMode(P, OUTPUT);\n  pinMode(S, OUTPUT);\n  pinMode(v, OUTPUT);\n  pinMode(p, OUTPUT);\n  pinMode(s, OUTPUT);\n  pinMode(l, OUTPUT);\n \n  // attach the servo on pin 14 (analog 0) to the servo object, \"tilt\"\n  tilt.attach(14);\n}\n\n  byte input;\n  byte x = 250;\n  byte i = 128;\n\nvoid loop(){\n  if (Serial.available()){\n    input = Serial.read();\n\n//Turn motors on/off at speed \"x\" (lower case) and direction (upper case) based on input of F (Forward), A (Aft), P (Port), S (Starbord), V (Vertical)\n      switch (input){\n        case \'F\':\n          digitalWrite(P, HIGH);\n          digitalWrite(S, HIGH);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'A\':\n          digitalWrite(P, LOW);\n          digitalWrite(S, LOW);\n          analogWrite(p, x);\n          analogWrite(s, x);         \n          break;\n        case \'P\':\n          digitalWrite(P, LOW);\n          digitalWrite(S, HIGH);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'S\':\n          digitalWrite(P, HIGH);\n          digitalWrite(S, LOW);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'U\':\n          digitalWrite(V, HIGH);\n          analogWrite(v, x);\n          break;\n        case \'D\':\n          digitalWrite(V, LOW);\n          analogWrite(v, x);\n          break;\n        case \'h\':\n          i++;\n          analogWrite(l, i);\n          break;\n        case \'l\':\n          i--;\n          analogWrite(l, i);\n          break;\n        case \'1\':\n          x = 50;\n          break;\n        case \'2\':\n          x = 150;\n          break;\n        case \'3\':\n          x = 250;\n          break;\n        case \'q\':\n          pos = 30;\n          break;\n        case \'a\':\n          pos = 80;\n          break;\n        case \'z\':\n          pos = 150;\n          break;\n        default:\n          analogWrite(s, 0);\n          analogWrite(v, 0);\n          analogWrite(p, 0);\n          //pos = 80;\n       }\n\n    // set servo position according to value of pos\n    tilt.write(pos);\n    }\n}\n</code>','utf-8'),(44,'<code lang=\'processing\'>\n//TSCROV-1 (Top-Side Controller for ROV-1)\n//Created by Eric Stackpole for OpenROV\n//This code allows a computer to output serial commands to control three motors, a light, and a servo based on keyboard input from the user\n//This program works with \"OBCROV-1 (On-Board Controller for ROV-1)\" which can be found on OpenROV.com\n//To see a video of the code working, watch the YouTube Video at http://www.youtube.com/watch?v=8r7Kt1p31vs\n\n//TSCROV-1 by Eric Stackpole is licensed under a Creative Commons Attribution-NonCommercial-ShareAlike 3.0 Unported License.\n//For more informatino, please visit OpenROV.com\n\nimport processing.serial.*;\nSerial port;\n\nvoid setup(){\n  println(Serial.list());\n  port = new Serial(this, Serial.list()[0], 9600);\n}\n   \n\n//Keyboard commands are intended to control the ROV as follows: \"q\", \"a\", and \"z\" control the servo (camera tilt) position; \"h\" and \"l\" (high and low) control light intensity; and \"1\", \"2\", and \"3\" control thruster speed level\n\nvoid draw() {\n  if (keyPressed){\n    switch (key){\n      case \'q\': port.write(\'q\');break; //Look up\n      case \'a\': port.write(\'a\');break; //Look stright\n      case \'z\': port.write(\'z\');break; //Look down\n      case \'h\': port.write(\'h\');break; //Increase light intensity\n      case \'l\': port.write(\'l\');break; //Decrease light intensity\n      case \'1\': port.write(\'1\');break; //Low motor speed\n      case \'2\': port.write(\'2\');break; //Medium motor speed\n      case \'3\': port.write(\'3\');break; //High motor speed\n    }\n   \n    // Arrow keys control forward/ backward and rotation movement of ROV intuitivly, shift and control control vertical motion\n    if (key == CODED){\n      switch (keyCode){\n        case UP: port.write(\'F\');break;      //Move forward\n        case DOWN: port.write(\'A\');break;    //Move aft\n        case LEFT: port.write(\'P\');break;    //Rotate to port (left)\n        case RIGHT: port.write(\'S\');break;   //Rotate to starbord (right)\n        case SHIFT: port.write(\'U\');break;   //Move up\n        case CONTROL: port.write(\'D\');break; //Move down\n        default: port.write(\'0\');break;      //Default to \"0\" which does nothing do decrese likelyhood of unintended commands\n      }\n    }\n  }\n   else port.write(\'0\');\n}\n</code>','utf-8'),(45,'\n{| class=\"wikitable\"\n|-\n| Example || [[Getting Started]]\n|-\n| Example || [[Downloads]]\n|-\n| Example || [[Assembly]]\n|-\n| Example || [[Deployment]]\n|-\n| Example || [[Troubleshooting]]\n|}','utf-8'),(46,'\n{| class=\"wikitable\"\n|-\n| [[File:Gauge.png]] || [[Getting Started]]\n|-\n| [[File:Crate.png]] || [[Downloads]]\n|-\n| [[File:Book.png]] || [[Assembly]]\n|-\n| [[File:Videos.jpeg]] || [[Deployment]]\n|-\n| [[File:Question.png]] || [[Troubleshooting]]\n|}','utf-8'),(47,'{| \n|-\n| [[File:Gauge.png]] || [[Getting Started]]\n|-\n| [[File:Crate.png]] || [[Downloads]]\n|-\n| [[File:Book.png]] || [[Assembly]]\n|-\n| [[File:Videos.jpeg]] || [[Deployment]]\n|-\n| [[File:Question.png]] || [[Troubleshooting]]\n|}','utf-8'),(48,'==About==\nOpenROV is a  Do It Yourself telerobotics community centered around underwater exploration and education. We have developed a low-cost telerobotic submarine that can be built with mostly off-the-shelf parts. The goal of OpenROV is to democratize exploration by allowing anyone to explore and study underwater environments. The  [http://openrov.com/forum OpenROV community] is also laying the foundation for globally-connected citizen scientists to share their data and findings.  Questions or suggestions? Feel free to email us at \n[mailto:Info@OpenROV.com Info@OpenROV.com].\n\n----\n\n{| \n|-\n| [[File:Gauge.png]] || [[Getting Started]]\n|-\n| [[File:Crate.png]] || [[Downloads]]\n|-\n| [[File:Book.png]] || [[Assembly]]\n|-\n| [[File:Videos.jpeg]] || [[Deployment]]\n|-