l Mar || || Scottsdale || AZ || USA ||\n|-\n| 033 || || || || || ||\n|-\n| 034 || [[User:Fusion94|Tony Guntharp]] || || Half Moon Bay || CA || USA ||\n|-\n| 035 ||  || || || || ||\n|-\n| 036 || Jacob Guldberg || OpenROV 2.2 || || || ||\n|-\n| 037 || Alessandro Fabbris || OpenROV 2.2 || || || ||\n|-\n| 038 || Brad Collette || OpenROV 2.2 || || || ||\n|-\n| 039 || Stephen Olsen || OpenROV 2.3.2 || Fremont || CA || USA ||\n|-\n| 040 || Stephen Olsen || OpenROV 2.3.2 || Fremont || CA || USA ||\n|-\n| 041 || Stephen Olsen || OpenROV 2.3.2|| Fremont || CA || USA ||\n|-\n|}','utf-8'),(130,'\nTwitter\n\nFacebook','utf-8'),(131,'\n==== Twitter ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Followers !! +/-\n|-\n| July 1st, 2012 || 408 || -\n|-\n| July 8th, 2012 || ||\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}\n\n==== Facebook ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Likes !! +/-\n|-\n| July 1st, 2012 || 244 || -\n|-\n| July 8th, 2012 || ||\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}','utf-8'),(132,'We use Github to host our code.  Please visit the Github profile at: [http://github.com/OpenROV http://github.com/OpenROV]\n\nWe separate the assets into 3 categories:\n\n* [http://github.com/OpenROV/openrov-hardware Hardware]\n* [http://github.com/OpenROV/openrov-software Software]\n* [http://github.com/OpenROV/openrov-electronics Electronics]\n\nThe hardware section contains the CAD files for cutting the ROV.  The software section contains the software for running the ROV (the software that runs on the on-board computer and Arduino).  The electronics section contains the schematic files for the BeagleBone cape.  Each section will probably be expanded, but we may combine some parts if it makes sense.','utf-8'),(133,'==== Overview ====\nWe use Git as our version control system and Github as our central repository.  For this reason, if you plan on contributing to OpenROV it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git and Github.  With this knowledge, you\'ll better understand how we manage our open-source projects.  Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n==== Learning Git and Github ====\n \nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n* [http://git-scm.com/ Git Official Website]\n* Michael Marner\'s [http://www.youtube.com/user/MichaelMarner#p/u/9/HaSDIdNkCDQ Git Tutorial] (video)\n* Github [http://learn.github.com/p/intro.html Introduction to Git] (video)\n* Linus Torvalds\' [http://www.youtube.com/watch?v=4XpnKHJAok8 Git Tech Talk] (video)\n* The [http://progit.org/book/ Pro Git Book]\n* the git help command and the [http://www.kernel.org/pub/software/scm/git/docs/ Git online manual]\n* [http://gitref.org/ Github Git Reference] (manual)\n* the Freenode IRC server\'s #git channel\n* and [http://www.google.com/search?hl=en&q=git+version+control many others]\n\n==== Git Prerequisites ====\n\nBefore you start, you will need to work through these points:\n\n* configure SSH, required for pushing branches to Github. See \"Generating SSH Keys\" for [http://help.github.com/linux-key-setup/ Linux], [http://help.github.com/mac-key-setup/ Mac OSX] and [http://help.github.com/msysgit-key-setup/ Windows].\n\n==== Some Quick Git Tips ====\n* use [http://gitk.sourceforge.net/development.html gitk] to give a visual representation of your repository\n* by default, if a file\'s permissions change, Git will perceive it just the same as if its contents were changed, Thus, to ignore permissions changes, run:\n\n<code>git config core.filemode false</code>\n\n==== Committing Code with Git in 7 Easy Stages ====','utf-8'),(134,'==== Overview ====\nWe use Git as our version control system and Github as our central repository.  For this reason, if you plan on contributing to OpenROV it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git and Github.  With this knowledge, you\'ll better understand how we manage our open-source projects.  Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n==== Learning Git and Github ====\n \nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n* [http://git-scm.com/ Git Official Website]\n* [http://try.github.com/ Try Git]\n* Michael Marner\'s [http://www.youtube.com/user/MichaelMarner#p/u/9/HaSDIdNkCDQ Git Tutorial] (video)\n* Github [http://learn.github.com/p/intro.html Introduction to Git] (video)\n* Linus Torvalds\' [http://www.youtube.com/watch?v=4XpnKHJAok8 Git Tech Talk] (video)\n* The [http://progit.org/book/ Pro Git Book]\n* the git help command and the [http://www.kernel.org/pub/software/scm/git/docs/ Git online manual]\n* [http://gitref.org/ Github Git Reference] (manual)\n* the Freenode IRC server\'s #git channel\n* and [http://www.google.com/search?hl=en&q=git+version+control many others]\n\n==== Git Prerequisites ====\n\nBefore you start, you will need to work through these points:\n\n* configure SSH, required for pushing branches to Github. See \"Generating SSH Keys\" for [http://help.github.com/linux-key-setup/ Linux], [http://help.github.com/mac-key-setup/ Mac OSX] and [http://help.github.com/msysgit-key-setup/ Windows].\n\n==== Some Quick Git Tips ====\n* use [http://gitk.sourceforge.net/development.html gitk] to give a visual representation of your repository\n* by default, if a file\'s permissions change, Git will perceive it just the same as if its contents were changed, Thus, to ignore permissions changes, run:\n\n<code>git config core.filemode false</code>\n\n==== Committing Code with Git in 7 Easy Stages ====','utf-8'),(135,'==== Overview ====\nWe use Git as our version control system and Github as our central repository.  For this reason, if you plan on contributing to OpenROV it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git and Github.  With this knowledge, you\'ll better understand how we manage our open-source projects.  Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n==== Learning Git and Github ====\n \nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n* [http://git-scm.com/ Git Official Website]\n* [http://try.github.com/ Try Git] (interactive tutorial)\n* Michael Marner\'s [http://www.youtube.com/user/MichaelMarner#p/u/9/HaSDIdNkCDQ Git Tutorial] (video)\n* Github [http://learn.github.com/p/intro.html Introduction to Git] (video)\n* Linus Torvalds\' [http://www.youtube.com/watch?v=4XpnKHJAok8 Git Tech Talk] (video)\n* The [http://progit.org/book/ Pro Git Book]\n* the git help command and the [http://www.kernel.org/pub/software/scm/git/docs/ Git online manual]\n* [http://gitref.org/ Github Git Reference] (manual)\n* the Freenode IRC server\'s #git channel\n* and [http://www.google.com/search?hl=en&q=git+version+control many others]\n\n==== Git Prerequisites ====\n\nBefore you start, you will need to work through these points:\n\n* configure SSH, required for pushing branches to Github. See \"Generating SSH Keys\" for [http://help.github.com/linux-key-setup/ Linux], [http://help.github.com/mac-key-setup/ Mac OSX] and [http://help.github.com/msysgit-key-setup/ Windows].\n\n==== Some Quick Git Tips ====\n* use [http://gitk.sourceforge.net/development.html gitk] to give a visual representation of your repository\n* by default, if a file\'s permissions change, Git will perceive it just the same as if its contents were changed, Thus, to ignore permissions changes, run:\n\n<code>git config core.filemode false</code>\n\n==== Committing Code with Git in 7 Easy Stages ====','utf-8'),(136,'\n==== Twitter ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Followers !! +/-\n|-\n| July 1st, 2012 || 408 || -\n|-\n| July 8th, 2012 || 462 || +54\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}\n\n==== Facebook ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Likes !! +/-\n|-\n| July 1st, 2012 || 244 || -\n|-\n| July 8th, 2012 || ||\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}','utf-8'),(137,'\n==== Twitter ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Followers !! +/-\n|-\n| July 1st, 2012 || 408 || -\n|-\n| July 8th, 2012 || 462 || +54\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}\n\n==== Facebook ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Likes !! +/-\n|-\n| July 1st, 2012 || 244 || -\n|-\n| July 8th, 2012 || 306 || +62\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}','utf-8'),(138,'\n==== Twitter ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Followers !! +/-\n|-\n| July 1st, 2012 || 408 || -\n|-\n| July 8th, 2012 || 466 || +58\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}\n\n==== Facebook ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Likes !! +/-\n|-\n| July 1st, 2012 || 244 || -\n|-\n| July 8th, 2012 || 306 || +62\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}','utf-8'),(139,'\n==== Twitter ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Followers !! +/-\n|-\n| July 1st, 2012 || 408 || -\n|-\n| July 8th, 2012 || 466 || +58\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}\n\n==== Facebook ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Likes !! +/-\n|-\n| July 1st, 2012 || 244 || -\n|-\n| July 8th, 2012 || 309 || +65\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}','utf-8'),(140,'We use Github to host our code.  Please visit the Github profile at: [http://github.com/OpenROV http://github.com/OpenROV]\n\nWe\'ve broken it up into 3 categories:\n\n* [http://github.com/OpenROV/openrov-hardware Hardware]\n* [http://github.com/OpenROV/openrov-software Software]\n* [http://github.com/OpenROV/openrov-electronics Electronics]\n\nThe hardware section contains the CAD files for cutting the ROV.  The software section contains the software for running the ROV (the software that runs on the on-board computer and Arduino).  The electronics section contains the schematic files for the BeagleBone cape.  Each section will probably be expanded, but we may combine some parts if it makes sense.','utf-8'),(141,'==== Overview ====\nWe use Git as our version control system and Github as our central repository.  For this reason, if you plan on contributing to OpenROV, it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git and Github.  With this knowledge, not only will you better understand how we manage our open-source projects, but you\'ll also have the opportunity to start integrating this powerful version control system into your own workflow.\n\n==== Learning Git and Github ====\n \nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n* [http://git-scm.com/ Git Official Website]\n* [http://try.github.com/ Try Git] (interactive tutorial)\n* Michael Marner\'s [http://www.youtube.com/user/MichaelMarner#p/u/9/HaSDIdNkCDQ Git Tutorial] (video)\n* Github [http://learn.github.com/p/intro.html Introduction to Git] (video)\n* Linus Torvalds\' [http://www.youtube.com/watch?v=4XpnKHJAok8 Git Tech Talk] (video)\n* The [http://progit.org/book/ Pro Git Book]\n* the git help command and the [http://www.kernel.org/pub/software/scm/git/docs/ Git online manual]\n* [http://gitref.org/ Github Git Reference] (manual)\n* the Freenode IRC server\'s #git channel\n* and [http://www.google.com/search?hl=en&q=git+version+control many others]\n\n==== Git Prerequisites ====\n\nBefore you start, you will need to work through these points:\n\n* configure SSH, required for pushing branches to Github. See \"Generating SSH Keys\" for [http://help.github.com/linux-key-setup/ Linux], [http://help.github.com/mac-key-setup/ Mac OSX] and [http://help.github.com/msysgit-key-setup/ Windows].\n\n==== Some Quick Git Tips ====\n* use [http://gitk.sourceforge.net/development.html gitk] to give a visual representation of your repository\n* by default, if a file\'s permissions change, Git will perceive it just the same as if its contents were changed, Thus, to ignore permissions changes, run:\n\n<code>git config core.filemode false</code>\n\n==== Committing Code with Git in 7 Easy Stages ====','utf-8'),(142,'Learn about the software architecture.','utf-8'),(143,'= Architectural Overview =\n\nThe main architecture for ROVision is that of the [http://en.wikipedia.org/wiki/Client_server client-server model], where the ROV hosts the server and your computer is the client. The connection to the client is managed through WebSockets using [http://socket.io/ Socket.io].\n\nThe two main technologies we’re using for ROVision are [http://nodejs.org/ Node.js] and [http://opencv.willowgarage.com/ OpenCV]. Node.js is sort of like the “brains” of the ROV - it bridges the connection between the ROV and the user.\n\nIt can also be separated into two other sections: visual input and control input. The visual input is the images from the on-board webcam and the control input comes from the user (i.e. keyboard or gamepad control). When the user connects to the Node server, it spawns a child process - the camera capture process.\n\nThe capture process is where one can leverage the power of OpenCV to utilize amazing computer vision algorithms. This process constantly waits for output from the Node server in the form of timestamp-format strings over standard input (STDIN).\n\nEssentially, the Node process says “take a photo” (say, 30 times per second) to the capture process, which then captures and saves the photo to shared memory, after which it writes the timestamp-format string through standard out (STDOUT) to the Node server - as a sort of “here you go” response. The Node server then opens the file of the name it receives (timestamp-format string) and reads it as a base64-encoded string. Then, the Node server sends that string to the client.\n\nThe client receives the base64-encoded string through javascript which then updates the source attribute of the IMG tag to that string. The user sees a new image.\n\nSince Socket.io is a two-way communication layer, the user can send control commands to the ROV anytime. The user does so by interacting with the keyboard or gamepad, which sends string-formatted commands using javascript to the ROV. The Node server on the ROV then intercepts the move command which it then forwards to the on-board Arduino to actuate the motors.','utf-8'),(144,'If you want to learn about the software, please visit the [[SoftwareArchitecture|software architecture]] page.','utf-8');
